import React from "react";
import "./EditSearch.css";

function EditSearch(props) {
  const { editSearch, className } = props;

  return (
    <div className={`edit-search ${className || ""}`}>
      <img className="edit-search-1" src={editSearch} />
    </div>
  );
}

export default EditSearch;
